import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './YourMood.scss';

const YourMood = () => {
  const [quote, setQuote] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('https://quotes.rest/qod?category=inspire') // API for quotes of the day
      .then(response => {
        setQuote(response.data.contents.quotes[0].quote);  // Extract the quote text
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching quote:', error);
        setLoading(false);
      });
  }, []);

  return (
    <div className="your-mood-container">
      <h1>How are you feeling right now?</h1>
      <div className="cards-container">
        <div className="mood-card" style={{ backgroundImage: 'url(/path/to/your-image1.jpg)' }}>
          <div className="mood-text">Depressed</div>
        </div>
        <div className="mood-card" style={{ backgroundImage: 'url(/path/to/your-image2.jpg)' }}>
          <div className="mood-text">Anxious</div>
        </div>
        <div className="mood-card" style={{ backgroundImage: 'url(/path/to/your-image3.jpg)' }}>
          <div className="mood-text">Happy</div>
        </div>
        <div className="mood-card" style={{ backgroundImage: 'url(/path/to/your-image4.jpg)' }}>
          <div className="mood-text">Stressed</div>
        </div>
      </div>

      {/* Display the fetched quote */}
      {loading ? (
        <p>Loading quote...</p>
      ) : (
        <div className="quote-section">
          <h2>Did you know?</h2>
          <p>{quote}</p>
        </div>
      )}
    </div>
  );
};

export default YourMood;
